import React from "react";

const MenuItems = () => {
  return (
    <div className="ui borderless menu navbar">
      <a className="item">Work</a>
      <a className="item">Github</a>
      <a className="item">Resume</a>
      <a className="item">About</a>
    </div>
  );
};

export default MenuItems;
